import React from 'react';
import {
  Slider,
  SliderInput,
  SliderTrack,
  SliderTrackHighlight,
  SliderHandle,
  SliderMarker,
} from "@reach/slider";
import "@reach/slider/styles.css";


export default () => (
    <div>
    <SliderInput>
        <SliderTrack>
          //<SliderTrackHighlight />
          <SliderHandle />
        </SliderTrack>
      </SliderInput>
    </div>
  );
